import React from 'react';
import Col from "react-bootstrap/Col";
import InputGroup from 'react-bootstrap/InputGroup';
import Image from "react-bootstrap/Image";
import Form from "react-bootstrap/Form";

const onClickSelecto =() =>{

}

const MySelector = ({ img, item, onClickSelector,isSelectorClick}) => (
                                    <Col xs={4} >

                                        <InputGroup style={{height: '38px',marginBottom:'5px'}}>
                                            <InputGroup.Prepend>
                                                <Image alt=''
                                                       src={img}
                                                       style={{pointerEvents: 'none'}}/>

                                            </InputGroup.Prepend>

                                            <Form.Control className='mySelector' onClick={onClickSelector}
                                                          style={!isSelectorClick?
                                                              {background: 'url(https://img.icons8.com/ios/50/000000/collapse-arrow-filled.png) no-repeat right #DDD' }:
                                                              {background: 'url(https://img.icons8.com/ios/50/000000/expand-arrow-filled.png) no-repeat right #DDD' }
                                                          } as="select">

                                                {item.map((val,key) =>{
                                                    return <option key={key} >{val} </option>
                                                })}

                                            </Form.Control>
                                        </InputGroup>
                                    </Col>

);
export default MySelector;
